import './App.css';

function App() {
  const [user,setUser]=useState(null)
  return (
        <BrowserRouter>
     {/* <Navigation/> */ } 
            <Routes>
                <Route index element={<Form callback={setUser}/>}></Route>
                <Route path='/ticket' element={<Ticket user={user}/>}></Route>
            </Routes>
        </BrowserRouter>

  );
}

export default App;
